//Footer.js Module
import React from 'react'

function Footer()
{
    return(
        <>
           <div className="container-fluid bg-dark">
            <div className="container p-5">

            <div className="row">
                <div className="col-lg-12">
                    <p className="text-white"> Copyright &copy; 2020 Creative Multimedia </p>

                </div>

            </div>
            </div>

           </div>
        </>
    )

}
export default Footer;
